import React from 'react';
import './skills.scss';

export default function Skills() {
  return(
  <div className='Skills'>
   <div className='first'>

   <LineProgressBar
   progressColor='crimson'
  percent={70}
  rounded={26}
  height={26}
  width={350}
/>
  </div>
  </div>
  );
}
